import Container from "react-bootstrap/Container";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";

function CustomFormCheck() {
    return null;
}

export const AllProductsPage = () => {



    return (
        <Container>
            <Row>
                <Col ml={3}md={3} ms={3}>
                            <CustomFormCheck/>
                </Col>
                <Col ml={9}md={9} ms={9}>

                </Col>
            </Row>
         </Container>
    )
}
